import { leadsActions } from "./leads-slice";

const url = "http://localhost:8080";

export const getFields = (orgId, token) => {

    return  (dispatch) => {
        dispatch(leadsActions.addFields({
            fields: {one: "1", two:"2", three:"3"}
        }))
    }
};
